import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  const expenses = props.expenses;
  const expenseItems = [];

  expenses.array.forEach((expense) => {
    expenseItems.push(
      <ExpenseItem
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    );
  });

  return(
    <div>
        {expenseItems}
    </div>
  )
}

export default Expenses;
